import "./Header.scss";
import search from "./Important-img/search.svg"
import icons from "./Important-img/Icons.png"
import pro from "./Important-img/Userpic.png"
import Logo from "./img/Logo_Black@3x.png"
import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header className="header">
      <div className="header__info">
      <Link className="header__logo" href="Logo" to={"home"}>
                        <img src={Logo} alt="Logo" width={106} height={25}/>
                    </Link>
      </div>
    </header>
  );
}
